window.bookSummaryJSON = "<p><b>Fate paired me with the one she-wolf I could never trust.</b><br> Five years ago, my beautiful neighbor Carlotta betrayed me.<br> My family was destroyed.<br> Because of her, the pack banished my father,<br> relegating me and my mom with a lowered status, barely able to scrape by.<br> <br> Carlotta left town before I found out why she did it.<br> Before I had the chance to make her pay.<br> But now she’s back.<br> She hasn’t changed much, but I have.<br> I’m twice her size now. Far more dominant.<br> And I just discovered she belongs to me.<br> Which means Carlotta James is completely at my mercy.<br> And I do intend to make her beg.<br> <br> <i>USA Today bestselling author Renee Rose delivers on this intense new adult forbidden love shifter bully romance.</i></p>"; 
